(16, 'UC8butISFwT-Wl7EV0hUK0BQ', 'Calculus 1 - Full College Course', 'Learn Calculus 1 in this full college course.\\n\\nThis course was created by Dr. Linda Green, a lecturer at the University of North Carolina at Chapel Hill. Check out her YouTube channel: https://www.youtube.com/channel/UCkyLJh6hQS1TlhUZxOMjTFw\\n\\nThis course combines two courses taught by Dr. Green. She teaches both Calculus 1 and a Calculus 1 Corequisite course, designed to be taken at the same time. In this video, the lectures from the Corquisite course, which review important Algebra and Trigonometry concepts, have been interspersed with the Calculus 1 lectures at the places suggested by Dr. Green.\\n\\n‚≠êÔ∏è Prerequisites ‚≠êÔ∏è\\nüé• Algebra: https://www.youtube.com/watch?v=LwCRRUa8yTU\\nüé• Precalculus: https://www.youtube.com/watch?v=eI4an8aSsgw\\n\\n‚≠êÔ∏è Lecture Notes ‚≠êÔ∏è\\nüîó Calculus 1 Corequisite Notes: http://lindagreen.web.unc.edu/files/2020/08/courseNotes_math231L_2020Fall.pdf\\nüîó Calculus 1 Notes: http://lindagreen.web.unc.edu/files/2019/12/courseNotes_m231_2018_S.pdf\\n\\n‚≠êÔ∏è Course Contents ‚≠êÔ∏è\\n(0:00:00) [Corequisite] Rational Expressions\\n(0:09:40) [Corequisite] Difference Quotient\\n(0:18:20) Graphs and Limits\\n(0:25:51) When Limits Fail to Exist\\n(0:31:28) Limit Laws\\n(0:37:07) The Squeeze Theorem\\n(0:42:55) Limits using Algebraic Tricks\\n(0:56:04) When the Limit of the Denominator is 0\\n(1:08:40) [Corequisite] Lines: Graphs and Equations\\n(1:17:09) [Corequisite] Rational Functions and Graphs\\n(1:30:35) Limits at Infinity and Graphs\\n(1:37:31) Limits at Infinity and Algebraic Tricks\\n(1:45:34) Continuity at a Point\\n(1:53:21) Continuity on Intervals\\n(1:59:43) Intermediate Value Theorem\\n(2:03:37) [Corequisite] Right Angle Trigonometry\\n(2:11:13) [Corequisite] Sine and Cosine of Special Angles\\n(2:19:16) [Corequisite] Unit Circle Definition of Sine and Cosine\\n(2:24:46) [Corequisite] Properties of Trig Functions\\n(2:35:25) [Corequisite] Graphs of Sine and Cosine\\n(2:41:57) [Corequisite] Graphs of Sinusoidal Functions\\n(2:52:10) [Corequisite] Graphs of Tan, Sec, Cot, Csc\\n(3:01:03) [Corequisite] Solving Basic Trig Equations\\n(3:08:14) Derivatives and Tangent Lines\\n(3:22:55) Computing Derivatives from the Definition\\n(3:34:02) Interpreting Derivatives\\n(3:42:33) Derivatives as Functions and Graphs of Derivatives\\n(3:56:25) Proof that Differentiable Functions are Continuous\\n(4:01:09) Power Rule and Other Rules for Derivatives\\n(4:07:42) [Corequisite] Trig Identities\\n(4:15:14) [Corequisite] Pythagorean Identities\\n(4:20:35) [Corequisite] Angle Sum and Difference Formulas\\n(4:28:31) [Corequisite] Double Angle Formulas\\n(4:36:01) Higher Order Derivatives and Notation\\n(4:39:22) Derivative of e^x\\n(4:46:52) Proof of the Power Rule and Other Derivative Rules\\n(4:56:31) Product Rule and Quotient Rule\\n(5:02:09) Proof of Product Rule and Quotient Rule\\n(5:10:40) Special Trigonometric Limits\\n(5:17:31) [Corequisite] Composition of Functions\\n(5:29:54) [Corequisite] Solving Rational Equations\\n(5:40:02) Derivatives of Trig Functions\\n(5:46:23) Proof of Trigonometric Limits and Derivatives\\n(5:54:38) Rectilinear Motion\\n(6:11:41) Marginal Cost\\n(6:16:51) [Corequisite] Logarithms: Introduction\\n(6:25:32) [Corequisite] Log Functions and Their Graphs\\n(6:36:17) [Corequisite] Combining Logs and Exponents\\n(6:40:55) [Corequisite] Log Rules\\n(6:49:27) The Chain Rule\\n(6:58:44) More Chain Rule Examples and Justification\\n(7:07:43) Justification of the Chain Rule\\n(7:10:00) Implicit Differentiation\\n(7:20:28) Derivatives of Exponential Functions\\n(7:25:38) Derivatives of Log Functions\\n(7:29:38) Logarithmic Differentiation\\n(7:37:08) [Corequisite] Inverse Functions\\n(7:51:22) Inverse Trig Functions\\n(8:00:56) Derivatives of Inverse Trigonometric Functions\\n(8:12:11) Related Rates - Distances\\n(8:17:55) Related Rates - Volume and Flow\\n(8:22:21) Related Rates - Angle and Rotation\\n(8:28:20) [Corequisite] Solving Right Triangles\\n(8:34:54) Maximums and Minimums\\n(8:46:18) First Derivative Test and Second Derivative Test\\n(8:51:37) Extreme Value Examples\\n(9:01:33) Mean Value Theorem\\n(9:09:09) Proof of Mean Value Theorem\\n(0:14:59) [Corequisite] Solving Right Triangles\\n(9:25:20) Derivatives and the Shape of the Graph\\n(9:33:31) Linear Approximation\\n(9:48:28) The Differential\\n(9:59:11) L\'Hospital\'s Rule\\n(10:06:27) L\'Hospital\'s Rule on Other Indeterminate Forms\\n(10:16:13) Newtons Method\\n(10:27:45) Antiderivatives\\n(10:33:24) Finding Antiderivatives Using Initial Conditions\\n(10:41:59) Any Two Antiderivatives Differ by a Constant\\n(10:45:19) Summation Notation\\n(10:49:12) Approximating Area\\n(11:04:22) The Fundamental Theorem of Calculus, Part 1\\n(11:15:02) The Fundamental Theorem of Calculus, Part 2\\n(11:22:17) Proof of the Fundamental Theorem of Calculus\\n(11:29:18) The Substitution Method\\n(11:38:07) Why U-Substitution Works\\n(11:40:23) Average Value of a Function\\n(11:47:57) Proof of the Mean Value Theorem for Integrals', 'https://i.ytimg.com/vi/HfACrKJ_Y2w/default.jpg', 'freeCodeCamp.org', 'https://www.youtube.com/watch?v=HfACrKJ_Y2w'),
(17, 'UC8butISFwT-Wl7EV0hUK0BQ', 'Android Development for Beginners - Full Course', 'Learn how to develop an android app from scratch in this full course for beginners. No prior programming experience required!\\nHere is the 2nd part of this course (also free!): https://youtu.be/RcSHAkpwXAQ\\n\\nIn this course, you will learn how to build a real-word Android application from scratch using Java. On the way to building an Android app, you will learn the basics of programming in Java and object-oriented programming.\\n\\n‚úèÔ∏è Course from MeiCode. Check out his YouTube channel: https://www.youtube.com/channel/UCE3wAhsfp4wGRgHXIQjVx0w\\n\\nExtended 55-hour course: https://courses.meicode.org/courses/android2020\\n\\n‚≠êÔ∏è Course Contents ‚≠êÔ∏è\\n‚å®Ô∏è (0:00) Course Introduction\\n‚å®Ô∏è (3:12) Setup The Environment\\n‚å®Ô∏è (18:52) Create Your First Application (Part 1)\\n‚å®Ô∏è (43:53) Create Your First Application (Part 2)\\n‚å®Ô∏è (59:20) Challenge\\n‚å®Ô∏è (1:07:19) Variables and Arithmetic Operators\\n‚å®Ô∏è (1:31:12) Relational and Logical Operators) Conditional Statements\\n‚å®Ô∏è (1:47:43) Loops\\n‚å®Ô∏è (2:04:13) Challenge (Create a Game)\\n‚å®Ô∏è (2:16:00) Simple Arrays\\n‚å®Ô∏è (2:27:51) Object Oriented Programming (Part 1)\\n‚å®Ô∏è (2:49:30) Object Oriented Programming (Part 2)\\n‚å®Ô∏è (3:06:02) Object Oriented Programming (Part 3)\\n‚å®Ô∏è (3:19:41) OOP Challenge\\n‚å®Ô∏è (3:43:56) Collections in Java\\n‚å®Ô∏è (4:06:14) Static Keyword - Inner Classes\\n‚å®Ô∏è (4:17:04) Interfaces and Abstract Classes\\n‚å®Ô∏è (4:35:26) Concurrency - Exceptions\\n‚å®Ô∏è (4:46:05) Singleton Pattern\\n‚å®Ô∏è (4:56:00) Challenge (Part 1)\\n‚å®Ô∏è (5:18:16) Challenge (Part 2)\\n‚å®Ô∏è (5:39:40) User Interface Basics (Part 1)\\n‚å®Ô∏è (6:04:21) User Interface Basics (Part 2)\\n‚å®Ô∏è (6:33:09) User Interface Basics (Part 3)\\n‚å®Ô∏è (6:58:39) Layouts\\n‚å®Ô∏è (7:26:53) Images\\n‚å®Ô∏è (7:37:32) ListView and Spinner\\n‚å®Ô∏è (8:00:57) Different XML Files (Part 1)\\n‚å®Ô∏è (8:29:41) Different XML Files (Part 2)\\n‚å®Ô∏è (8:41:09) Material Design\\n‚å®Ô∏è (8:59:58) Snackbar and CardView\\n‚å®Ô∏è (9:16:51) RecyclerView (Part 1)\\n‚å®Ô∏è (9:39:02) RecyclerView (Part 2)\\n‚å®Ô∏è (10:03:50) RecyclerView (Part 3)\\n‚å®Ô∏è (10:22:26) Fonts\\n‚å®Ô∏è (10:38:35) Challenge (Part 1)\\n‚å®Ô∏è (10:57:16) Challenge (Part 2)\\n‚å®Ô∏è (10:13:18) Create App\'s First Page - Intents\\n‚å®Ô∏è ‚≠êÔ∏è More in part 2: https://youtu.be/RcSHAkpwXAQ', 'https://i.ytimg.com/vi/fis26HvvDII/default.jpg', 'freeCodeCamp.org', 'https://www.youtube.com/watch?v=fis26HvvDII'),
(18, 'UC8butISFwT-Wl7EV0hUK0BQ', 'Git and GitHub for Beginners - Crash Course', 'Learn about Git and GitHub in this tutorial. These are important tools for all developers to understand. Git and GitHub make it easier to manage different software versions and make it easier for multiple people to work on the same software project.\\n\\nThis course was developed by Gwen Faraday. Check out her YouTube channel: https://www.youtube.com/channel/UCxA99Yr6P_tZF9_BgtMGAWA \\n\\nüîó Git Commands: https://gist.github.com/gwenf/19e5748a5391929e8e938a22c8a4b3f2\\nüîó Install git: https://www.atlassian.com/git/tutorials/install-git\\nüîó SSH Keys: https://help.github.com/en/github/authenticating-to-github/generating-a-new-ssh-key-and-adding-it-to-the-ssh-agent\\n\\n\\n‚≠êÔ∏è Contents ‚≠êÔ∏è\\n‚å®Ô∏è (0:00) Introduction\\n‚å®Ô∏è (1:10) What is git?\\n‚å®Ô∏è (1:30) What is version control?\\n‚å®Ô∏è (2:10) Terms to be learn in video\\n‚å®Ô∏è (5:20) Git commands\\n‚å®Ô∏è (7:05) sign up in GitHub\\n‚å®Ô∏è (11:32) using git in local machine\\n‚å®Ô∏è (11:54) git install\\n‚å®Ô∏è (12:48) getting code editor\\n‚å®Ô∏è (13:30) inside VS Code\\n‚å®Ô∏è (14:30) cloning through VS Code\\n‚å®Ô∏è (17:30) git commit command\\n‚å®Ô∏è (18:15) git add command\\n‚å®Ô∏è (19:15) committing\\n‚å®Ô∏è (20:20) git push command\\n‚å®Ô∏è (20:30) SSH Keys\\n‚å®Ô∏è (25:25) git push\\n‚å®Ô∏è (30:21) Review workflow so far\\n‚å®Ô∏è (31:40) Compare between GitHub workflow and local git workflow\\n‚å®Ô∏è (32:42) git branching\\n‚å®Ô∏è (56:30) Undoing in git\\n‚å®Ô∏è (1:01:50) Forking in git\\n‚å®Ô∏è (1:07:55) Ending\\n\\n\\n\\nThanks to Harsh Raj for creating these time codes and section descriptions.\\n\\n\\n\\n--\\n\\nLearn to code for free and get a developer job: https://www.freecodecamp.org\\n\\nRead hundreds of articles on programming: https://freecodecamp.org/news\\n\\nAnd subscribe for new videos on technology every day: https://youtube.com/subscription_center?add_user=freecodecamp', 'https://i.ytimg.com/